import React from "react";

const About = () => {
  return (
    <div>
      <div className="row">
        <div className="col-md-6">
          <h3>About Me</h3>
          <div className="text-justify">
            <p>
              Hello! I am Abdur Rahman. A Junior Web Developer. I Develop
              Frontend Web Applications and Back-end web Applications. my core
              skill is based on javascript and I love to do most of the things
              using javascript.
            </p>
          </div>
        </div>
        <div className="col-md-6"></div>
      </div>
    </div>
  );
};

export default About;
